syntax = "proto3";

message jfz {
  int32 eokn = 1;
  repeated jfx eoko = 2;
  string eokp = 3;
  int32 eokq = 4;
  int32 eokr = 5;
  enum jfx {
    BREACH_REWARD_LOCK_OWNER = 0;
    BREACH_REWARD_LOCK_FIGHTER = 1;
    BREACH_REWARD_LOCK_RESOURCES = 2;
    BREACH_REWARD_LOCK_CRITERION = 3;
    BREACH_REWARD_LOCK_USELESS = 4;
    BREACH_REWARD_MAX_PURCHASE_REACHED = 5;
  }
}
